// OrderForm.js
import React, { useState } from 'react';
import axios from 'axios';

const OrderForm = () => {
  const [fullname, setFullname] = useState('');
  // Các trường dữ liệu khác của đơn đặt hàng

  const handleOrder = () => {
    // Gửi dữ liệu đơn đặt hàng đến backend
    axios.post('http://localhost:8080/api/orders', {
      fullname: fullname,
      // Các trường dữ liệu khác của đơn đặt hàng
    })
    .then(response => {
      console.log('Đơn đặt hàng thành công:', response.data);
      // Xử lý sau khi đặt hàng thành công
    })
    .catch(error => {
      console.error('Đặt hàng thất bại:', error);
      // Xử lý sau khi đặt hàng thất bại
    });
  };

  return (
    <div>
      {/* Form đặt hàng */}
      <label>Fullname:</label>
      <input type="text" value={fullname} onChange={(e) => setFullname(e.target.value)} />
      {/* Các trường dữ liệu khác của đơn đặt hàng */}
      <button onClick={handleOrder}>Đặt Hàng</button>
    </div>
  );
};

export default OrderForm;
